import React from "react";
import './App.css';
import {BrowserRouter as Router, Routes, Route, BrowserRouter} from "react-router-dom"

function App() {
  return (
    <BrowserRouter>
      <div className="app">
        <Routes>
          <Route path="/checkout">
            <h1>Checkout</h1>
          </Route>
          <Route path="/login">
            <h1>Login page</h1>
          </Route>
          <Route path="/">
            <h1>homepage</h1>
          </Route>
        </Routes>
      </div>
    </BrowserRouter>

  );
}

export default App;
